import styled from "styled-components";

const Login = (props) => {
  return (
    <Container>
      <Content>Content</Content>
    </Container>
  );
};

const Container = styled.section`
  overflow: hidden;
  display: flex;
`;

const Content = styled.div``;

export default Login;
